const toggleSidebar = () => {
    const sidebar = document.getElementById('sidebar')
    const chatSection = document.getElementById('chatSection')

    if (sidebar.classList.contains('hidden')) {
        sidebar.classList.remove('hidden')
        chatSection.classList.add('hidden')
    } else {
        sidebar.classList.add('hidden')
        chatSection.classList.remove('hidden')
    }
}

const sendPrompt = async () => {
    const userInput = document.getElementById('userInput').value
    const messageContainer = document.getElementById('messageContainer')
    const loadingIndicator = document.getElementById('loading')

    const userMessage = document.createElement('div')
    userMessage.classList.add('user-message')
    userMessage.textContent = userInput
    messageContainer.appendChild(userMessage)

    document.getElementById('userInput').value = ''
    loadingIndicator.style.display = 'flex'

    try {
        const response = await fetch('https://generativelanguage.googleapis.com/v1beta/models/gemini-1.5-flash-latest:generateContent?key=AIzaSyATsb5Oiz_kY9lAURtnVe3rMINS4wr_nFU', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({
                contents: [
                    {
                        "parts": [{
                            "text": "Com base nesses dados: " + softtekData + "\n" + "Tente solucionar o problema: " + userInput
                        }]
                    }
                ]
            })
        })

        const data = await response.json()
        let answer = data.candidates[0].content.parts[0].text

        // Format bold text
        answer = answer.replace(/\*\*(.*?)\*\*/g, '<b>$1</b>');

        // Format italic text
        answer = answer.replace(/\* (.*?)\ */g, '<i>$1</i>');

        // Format inline code
        answer = answer.replace(/`([^`]*)`/g, '<code>$1</code>');

        // Format code blocks
        answer = answer.replace(/```([^`]*)```/g, '<pre><code>$1</code></pre>');

        //Format headers (h1, h2, etc.)
        answer = answer.replace(/^### (.*$)/gim, '<h3>$1</h3>');
        answer = answer.replace(/^## (.*$)/gim, '<h2>$1</h2>');
        answer = answer.replace(/^# (.*$)/gim, '<h1>$1</h1>');

        const botMessage = document.createElement('div')
        botMessage.classList.add('bot-message')
        botMessage.innerHTML = answer

        // Add the bot message to the message container
        messageContainer.appendChild(botMessage)

        // Scroll to the bottom of the message container
        messageContainer.scrollTop = messageContainer.scrollHeight

    } catch (error) {
        const errorMessage = document.createElement('div')
        errorMessage.classList.add('bot-message', 'error-message')
        errorMessage.innerHTML = 'Ocorreu um erro ao se comunicar com a IA. Por favor, tente novamente mais tarde.'
        messageContainer.appendChild(errorMessage)
    } finally {
        loadingIndicator.style.display = 'none'
    }
}

const handleClickQuestion = (problem) => {
    document.getElementById('userInput').value = problem
    sendPrompt()
}